export function formatDate(date) {
    if (date === undefined) return "";
    let dateValidation = date;
    dateValidation = dateValidation.split("T")
    dateValidation = dateValidation[0] + ' ' + dateValidation[1];
    return dateValidation.slice(0, 19)
}
